def sum_odd_ints_inclusive(lst):
    odd_sum = 0
    for i in range(8, 10):
        if lst[i] % 2 != 0:
            odd_sum += lst[i]
    return odd_sum
```
Note: The provided code assumes that the list contains at least 10 elements. If the list is smaller, an IndexError might occur.
